Yezdi is one of the most powerful and handsome motorcycle of the 70s era.
Our club member Thakur ji (@thakursangram.singh.75) has recently purchased  and has restored this beautiful into an angelic classy.He was looking for an Yezdi since a long time when he came across this 1979 Model B Yezdi which was parked at the same place since 1988.
(OSC 9121,Old Cuttack Registration)
In its original condition, this Yezdi belonged to the first owner who was not riding it for some reasons and was looking for a passionate man who could take care of it.After about 3 months of hard work, it has just returned to its new home in a new retro style.
Congratulations to @thakursangram.singh.75
We all hope that it always remains safe with you
@prithwiraj._.das also has a big hand in this restoration, who has done a lot of work behind it,kudos.
